package various.common.light.cache.exception;

public class ResultCacheException extends Exception {

	private static final long serialVersionUID = -4139470813168095359L;

	public ResultCacheException() {
		super();
	}
	
	public ResultCacheException(String message, Throwable cause) {
		super(message, cause);
	}

	public ResultCacheException(String message) {
		super(message);
	}

	public ResultCacheException(Throwable cause) {
		super(cause);
	}
}
